import React from "react";
import ReactDOM from "react-dom";
import Notes from "./notes.js";

function createNote(n){
    return (<div className="note">
    <h1>{n.title}</h1>
    <p>{n.content}</p>
        
    </div>
    );
}

function Note(){
    Notes.map(nt => createNote(nt));
    
}

// Notes.map( note =>)


export default Note;
